import React from "react";


let arrrow = [];
for (let i = 0; i < 3; i++) {
  arrrow.push(0);
}
let arrcol = [];
for (let i = 0; i < 6; i++) {
  arrcol.push(0);
}

export default function Four() {
  const fourStyle = {
    height: "250px",
    width: "98px",
    boder: "1px solid black",
    backgroundColor: "grey",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    flexWrap: "wrap",
  };

  const row = {
    width: "32.5%",
    height: "250px",
    backgroundColor: "white",
    border: "0.2px solid black",
  };
  const col = {};
  return (
    <div style={fourStyle}>
      {arrrow.map((elerow, rowidx) => {
        return (
          <div style={row}>
            {
                                elerow.map((col, colidx)=>{
                                    return (
                                        <div style={col}>

                                        </div>
                                    )
                                })
            }
          </div>
        );
      })}
    </div>
  );
}
